import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 28.2-548 Duty to inspect.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/28.2-548.md","filePath":"vacode/28.2-548.md"}'),o={name:"vacode/28.2-548.md"},s=r('<h1 id="§-28-2-548-duty-to-inspect" tabindex="-1">§ 28.2-548 Duty to inspect. <a class="header-anchor" href="#§-28-2-548-duty-to-inspect" aria-label="Permalink to &quot;§ 28.2-548 Duty to inspect.&quot;">​</a></h1><p>It shall be the duty of the officer in whose district a cargo of oysters is to be loaded to inspect the oysters as they are loaded and to ensure that all measurements are a full measure of oysters as defined in § <a href="http://law.lis.virginia.gov/vacode/28.2-526/" target="_blank" rel="noreferrer">28.2-526</a> and that the oysters are properly culled.</p><p>Code 1950, §§ 28-103, 28-105; 1954, c. 367; 1960, c. 517; 1962, c. 406, § 28.1-90; 1992, c. 836; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0033" target="_blank" rel="noreferrer">33</a>; 2013, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0038" target="_blank" rel="noreferrer">38</a>.</p>',3),i=[s];function n(c,l,d,_,p,h){return t(),a("div",null,i)}const g=e(o,[["render",n]]);export{u as __pageData,g as default};
